const keys = Object.keys;

const LIST = require("./list");
const DATA = require("./legacy");

const KEYS = keys(LIST).concat(keys(DATA));

const both = {};
const list = {};
const data = {};

KEYS.forEach(key => {
  if (LIST[key] && DATA[key]) both[key] = DATA[key];
  else if (LIST[key]) list[key] = 1;
  else if (DATA[key]) data[key] = 1;
});

console.log("module.exports = {");
keys(data).forEach(key => {
  console.log(`"${key}": [null, "${DATA[key].join(" ")}"],`);
});
console.log("}");
